import { ReactElement} from "react";
import { NavBarProps } from "../../interface";
import { BoxNav } from "../header/style";
import { Button } from "../button/button";

export const NavBar = ({ setIsOpen }: NavBarProps): ReactElement => {
  const handleClose = () => {
    setIsOpen(false);
  };
  return (
    <BoxNav>
      <Button variant="text_button" variant_hover="text_button_hover" size="small" ></Button>
    </BoxNav>
  );

};
